import {React, useState, useEffect} from 'react';

export default function Navbar(props){

    const pages = [
        {title:'WORK'},
        {title:'SERVICES'},
        {title:'INDUSTRIES'},
        {title:'ABOUT'},
        {title:'CAREERS'},
        {title:'CONTACTS'}, 
    ];

      const pageList = pages.map(page=>{
        return (
          <div className='page-item'>
              <h1>{page.title}</h1>
          </div>
        )
    });

    return(
      <div className='pages-container'>
        {pageList}
      </div>
    )

}
